import React from "react";


const Hello = (props) => {
  return (
    <div>
      <p> Hello {props.name}, you are {props.age} years old</p>
    </div>
  )
}

const Footer = () => {
  return (
    <div>
      greeting app created by <a href='https://github.com/rd9911'>rd9911</a>
    </div>
  )
}

const App = () => {
  const age = 10;
  const name = 'Peter'
  return (
    <div>
      <h1>Greetings</h1>
      <Hello age={age} name={name} />
      <Footer />
    </div>
  )
}


export default App;
